      const [data, setData] = React.useState({

        error: '',
        data: [],
        temp: [],
        error: null,
        search: null,
        array: [],
        center: {
          lat: 33.886917,
          lng: 9.537499
        },
        zoom: 11
    
      });
  
 
  
    return (
      // Important! Always set the container height explicitly
      <div style={{ height: '100vh', width: '100%' }}>
        <GoogleMapReact
          bootstrapURLKeys={{ key:`AIzaSyD1lN2ArTGGjhdZrR1JI5bXj58JU9V5iUE`}}
          defaultCenter={data.center}
          defaultZoom={data.zoom}
        >
          <AnyReactComponent
            lat={33.886917}
            lng={9.537499}
            text="My Marker"
          />
        </GoogleMapReact>
      </div>
    );
  
}
 
